const dummy_data = [
	{
		id: "id-1",
		location: "nyc",
		image: "",
		description: "statue of liberty",
	},
	{
		id: "id-2",
		location: "sf",
		image: "",
		description: "golden gate bridge",
	},
];

function AllMeetupsPage() {
	return (
		<section>
			<div>All Meetups</div>
			<ul>
				{dummy_data.map((meetup) => {
					return <li>meetup.location</li>;
				})}
			</ul>
		</section>
	);
}
export default AllMeetupsPage;
